    false,nt"url": null,nt"notes": "This annual narrative report summarizes
    activities for Seney National Wildlife Refuge, Kirtlandu2019s Warbler National Wildlife
    Refuge, Harbor Island National Wildlife Refuge, Huron Islands National Wildlife
    Refuge, and Michigan Islands National Wildlife Refuge during the 1994 calendar year.
    The report begins with a summary of the yearu2019s highlights and climatic conditions.
    Land acquisition is also covered. The report includes a planning section which discusses
    compliance with environmental and cultural resource mandates, research, and investigations.
    Refuge administration is outlined; information about personnel, volunteer programs,
    funding, safety, and technical assistance is given. Habitat management is also covered.
    Subjects include wetlands, forests, haying, fire management, pest control, and Farmers
    Home Administration Conservation Easements. The wildlife section of the report discusses
    wildlife diversity, endangered species, threatened species, waterfowl, marsh birds,
    waterbirds, shorebirds, raptors, game mammals, fisheries resources, marking, and
    banding. The public uses of the Refuge described in this report include outdoor
    classrooms, interpretive exhibits, hunting, fishing, trapping, wildlife observation,
    camping, law enforcement, and cooperating associations. The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment utilization and replacement, communications systems,
    and computer systems. Refuge brochures are attached.",nt"license_title": "License
